{\"type\":1,\"content\":\"/fileUpload/2022-02-11/zengkefan__12__1644574928850.jpeg\"},{\"type\":2,\"content\":\"内容正文水电费水电费理解水电费教练说都疯了感觉龙卷风的快乐手里的积分老鼠大家放老鼠大家疯狂老鼠就到了疯狂介绍了快递放老鼠大家放老鼠的放老鼠的弗兰克司机端口兰芳。\"}]',20,1,'这是备注','2022-02-14 11:10:16','数商团队','0'),(21,'未来十年，有哪些职业会消失？','/fileUpload/2022-02-25/zengkefan__12__1645794992741.jpeg','说起 AI （人工智能），我们最耳熟能详的应属谷歌「阿尔法狗」（AlphaGo）。2017 年5月，在中国乌镇围棋峰会上，「阿尔法狗」与排名世界第一的世界围棋冠军柯洁对战，并以3比0的总比分获胜，自此围棋界公认阿尔法围棋的棋力已经超过人类职业围棋顶尖水平。','[{\"type\":2,\"content\":\"或许，阿尔法狗这一类的人工智能距离我们普通人还比较远，但很多弱人工智能已经逐渐地渗透到我们日常工作和生活之中，比如苹果的Siri、微软的Cortana、小米的小爱同学这类人工智能助理，比如你接到的说着一口流利普通话的AI广告电话推销员，比如你在酒店走廊碰见的人工智能机器人等等。\n\n我们不得不承认，在未来，职场上的竞争对手很可能不再是人类，真正觊觎你工作的可能是「机器人」。\n\n与此同时，我们也收到不少年轻朋友的困惑，未来职业应该怎么选？哪些职业未来会被AI替代？哪些职业未来会走红？因此，在这2022年伊始，36氪联合知乎发起了关于「未来职业」的提问，邀请知乎上超百位不同领域的答主参与解答，希望可以给年轻朋友开阔眼界、带来帮助、产生共鸣，看完有所收获。\n\n1、未来十年，哪些职业最容易被AI 取代？\n@遠夏（知乎科学领域答主）\n不涉及创作力的工作，例如体力劳动，在下一个十年更容易被AI取代。事实上，美国亚马逊已经在依靠AI来开除员工了，并且通过AI和机器人来节约成本。\n\n@陈敏（知乎健康领域答主）\n最容易被AI取代的行业很明显，最开始肯定是简单可重复的体力劳动（正在进行），其次是稍微需要思考的脑力劳动（即将发生），最后是所有职业的底层都被AI取代。\n\n@凌楚眠（知乎健康领域答主）\n也不能说有创造力的工作就不会被AI取代，从某种程度来说，我们的人工智能技术都比人类大脑的算力更强一些，即使是在特定的复杂的工作场景下，也会慢慢与人类媲美。\n\n如三位答主所言，简单又无需创造力的工作的确更容易被取代，根据剑桥学者研究的365种职业在未来的「被淘汰概率」，电话推销员、打字员、会计是最容易被 AI 替代的三种职业。相对而言，营养师、医生、牙医则不太容易被AI替代。\"},{\"type\":1,\"content\":\"/fileUpload/2022-02-25/zengkefan__12__1645795072969.png\"},{\"type\":2,\"content\":\"但除了大家公认的「简单可重复的工作容易被AI取代」外，有创造力的工作真的就能“高枕无忧”吗？我们还邀请了一些“有创造力工作”的嘉宾，一起来听听他们有什么不同观点。\n\n@一个男人在流浪（知乎科学领域答主）\n以往的观念认为，只有那些重复性的工作才会被AI替代，但在我的行业里，其实已经出现了AI写稿的情况。在知乎上，有一位叫“四十二”的AI答主，TA的回答流畅到让你几乎看不出屏幕背后的是一个AI，甚至已经形成了自己独特的“文风”。\"}]',26,1,'demo','2022-02-25 22:59:55','36氪','10'),(32,'这是标题','/fileUpload/image/assets/case3.png','这是封面简述','[{\"type\":2,\"content\":\"内容正文水电费水电费理解水电费教练说都疯了感觉龙卷风的快乐手里的积分老鼠大家放老鼠大家疯狂老鼠就到了疯狂介绍了快递放老鼠大家放老鼠的放老鼠的弗兰克司机端口兰芳。\"},{\"type\":1,\"content\":\"/fileUpload/image/assets/case3.png\"}]',20,1,'这是备注','2022-03-05 18:10:29','数商团队','5');
